import React from "react";
import phone from "./img/cards-icons/phone5.png";

const Calculator = () => {
  return (
    <>
      <div id="calculator">
        {/* <!-- Button trigger modal --> */}
        <button type="button" className="calculator__btn">
          <a href="tel:+918828507441">
          <img src={phone} alt=".." />
          </a>

        </button>
      </div>
    </>
  );
};

export default Calculator;
